import React, { useEffect, useState } from 'react'

function App() {
  const [date1, setDate] = useState('')

  useEffect(() => {
    fetch('https://jsonmock.hackerrank.com/datetime')
      .then(res => res.json())
      .then(data => setDate(data.date))
  }, [])
  console.log(date1)
  const splitDate = date1.split('-')
  console.log(splitDate[0])
  return (
    <div className="App">
      <h1>date: {splitDate[0]}</h1>
    </div>
  );
}

export default App;

